import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [births, setBirths] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:3001/api/births');
        setBirths(response.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="App">
      <h1>Birth Data (2016-2020)</h1>
      /*
      <table>
        <thead>
          <tr>
            <th>Municipality</th>
            <th>Year</th>
            <th>Male</th>
            <th>Female</th>
          </tr>
        </thead>
        <tbody>
          {births.map((birth) => (
            Object.keys(birth.births).map((year) => (
              <tr key={`${birth.municipality}-${year}`}>
                <td>{birth.municipality}</td>
                <td>{year}</td>
                <td>{birth.births[year].male}</td>
                <td>{birth.births[year].female}</td>
              </tr>
            ))
          ))}
        </tbody>
      </table>
      */
    </div>
  );
}

export default App;
